import React from "react";
import { Link } from "react-router-dom";
import "./style.css";
import Corona from "./corona-survival.png";
import LinkUp from "./link-up.png";
import Store from "./online-store.png";
import Index from "./employee-index.png";

function Portfolio() {
    return (
        <div>
            <div className="row">
                <div className="col-md-6">
                    <img className="center-block" src={Store} alt="luis brushing teeth" />
                </div>
                <div className="col-md-6">
                    <img className="center-block" src={LinkUp} alt="luis brushing teeth" />
                </div>
            </div>
            <div className="row">
                <div className="col-md-6">
                    <p className="top-app-titles">Website for Selling Websites</p>
                    <a target="_blank" className="top-app-titles" href="https://github.com/adamhayward/online_store">GitHub</a>

                </div>
                <div className="col-md-6">
                    <p className="top-app-titles">Link Up Socializing App</p>
                    <a target="_blank" className="top-app-titles" href="https://github.com/mpapamichalis/link-it">GitHub</a>
                    <a target="_blank" className="top-app-titles" href="https://link-up-pro.herokuapp.com/">Deployed App</a>
                </div>
            </div>

        </div>

    );

}

export default Portfolio;
